import React from 'react';
import {Link} from 'react-router-dom';

function Nav () {
  return (
    <nav style={headerStyle}>
      <h1>Login</h1>
      <Link to='/' style={linkStyle} >Home </Link> | <Link to='/register' style={linkStyle}>Register</Link> 
    </nav>
  );
}
const headerStyle = {
  background: '#333',
  color: '#fff',
  textAlign: 'center',
  padding: '10px'
}
const linkStyle = {
color: '#fff',
textDecoration: 'none'
}

export default Nav;
